import React, { Component } from "react";

export default class PlaylistCover extends Component{
    constructor(props){
        super(props);
        this.state = {
            playlistName: "Your Time Capsule",
            songNumber: 55,
            coverImage: "./cover.jpg"
        }
    }

    render(){
        return(
            <div>
            <div>{this.state.playlistName}</div>
            <div>{this.state.coverImage}</div>
            </div>
        )
    }
}
